import { Navigate, Route } from 'react-router-dom';

const ProtectedRoute = ({ component: Component, isLoggedIn, ...rest }) => {
  return (
    <Route {...rest} element={
      isLoggedIn ? <Component /> : <Navigate to="/login" />
    } />
  );
};

export default ProtectedRoute;
